    M[0, 2]=-(e123*e132*e311) + e122*e133*e311 + e123*e131*e312 - e121*e133*e312 - e122*e131*e313 + e121*e132*e313 + e113*e132*e321 - e112*e133*e321 - e113*e131*e322 + e111*e133*e322 + e112*e131*e323 - e111*e132*e323 - e113*e122*e331 + e112*e123*e331 + e113*e121*e332 - e111*e123*e332 - e112*e121*e333 + e111*e122*e333 # x**2*z
