    M[0,11]=+(e133*e222*e411) - e132*e223*e411 - e123*e232*e411 + e122*e233*e411 - e133*e221*e412 + e131*e223*e412 + e123*e231*e412 - e121*e233*e412 + e132*e221*e413 - e131*e222*e413 - e122*e231*e413 + e121*e232*e413 - e133*e212*e421 + e132*e213*e421 + e113*e232*e421 - e112*e233*e421 + e133*e211*e422 - e131*e213*e422 - e113*e231*e422 + e111*e233*e422 - e132*e211*e423 + e131*e212*e423 + e112*e231*e423 - e111*e232*e423 + e123*e212*e431 - e122*e213*e431 - e113*e222*e431 + e112*e223*e431 - e123*e211*e432 + e121*e213*e432 + e113*e221*e432 - e111*e223*e432 + e122*e211*e433 - e121*e212*e433 - e112*e221*e433 + e111*e222*e433 # x*y
